import React,{Component} from 'react';
import Railway from './Railway.PNG';

class CustomerDetails extends Component
{
    render() {
        return(
            <div style={rightStyle}>
             <div><img src={Railway} width="200px" height="250px" alt="Railway"/></div>
                <div style={{left:"100px",right:"200px"}}><button style={btnStyle}>View Bill</button></div>
            </div>
        );
    }
}

const rightStyle={
    position:'fixed',
    right:'1200px',
    left:'1200px',
    background:'LightGrey',
    width:'200px',
    height:'500px',
    textAlign:'left',
    border: '3px solid Black',
    borderTopStyle:'none'
};
const btnStyle={
    background:'red',
    color:'white',
    padding:'5px 8px',
    cursor:'pointer',
    float:'right'
};
export default CustomerDetails;
